interface ComputerProps {
  position: 'static' | 'absolute'
  type: 'small' | 'large'
}

export const Computer = ({ position, type }: ComputerProps) => {
  const logoSize = type === 'small' ? '220px' : '250px'
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
      style={{ position: `${position}`, top: '-120%', left: '200px' }}
      width={logoSize}
      height={logoSize}
      xmlSpace="preserve"
      version="1.1"
      viewBox="0 0 500 500">
      <image
        width="500"
        height="500"
        xlinkHref="data:image/png;base64,"
      />
    </svg>
  )
}
